import {
  Card, Col, Container, Row,
} from 'react-bootstrap';

function ProjectView() {
  return (
    <Container>
      <Card className="pt-5">
        <Row>
          <Col />
          <Col><h1 className="d-flex justify-content-center display-5 pb-5">Projects</h1></Col>
          <Col />
        </Row>
      </Card>
    </Container>
  );
}

export default ProjectView;
